import React from "react";

import { Navigate } from "react-router-dom"

class WelcomePage extends React.Component{
    
    constructor(){
        super();
        this.state = {};
    }

    render(){
        return(
            <div>
                <Link to='/Accueil'>WhatToCook</Link>
                <p>Page d'accueil</p>
            </div>
        );
    }
}

export default WelcomePage;
